import { makeStyles } from '@material-ui/core/styles';
import Grid from '@material-ui/core/Grid';
import TextField from '@material-ui/core/TextField';
import Divider from '@material-ui/core/Divider';
import ButtonGroup from '@material-ui/core/ButtonGroup';
import Button from '@material-ui/core/Button';

const useStyles = makeStyles((theme) => ({
    root: {
      width: '100%',
      maxWidth: 360,
      backgroundColor: theme.palette.background.paper,
    },
    chip: {
      margin: theme.spacing(0.5),
    },
    section1: {
      margin: theme.spacing(3, 2),
    },
    section2: {
      margin: theme.spacing(2),
    },
    section3: {
      margin: theme.spacing(3, 1, 1),
    },
  }));
const classes = useStyles();

const Menu = () =>(
    <div className={classes.root}>
        <div className={classes.section1}>
            <Grid container alignItems="center">
                <Grid item>
                    <TextField id="" label="Fideicomiso" defaultValue="0000" />
                </Grid>
                <Grid item>
                    <TextField id="" label="Sub Fiso" defaultValue="0000" />
                </Grid>
                <Grid item>
                    <TextField id="" label="Tipo de Bien (Cambiar por Select desde BD)" />
                </Grid>
                <Grid item>
                    <TextField id="" label="Descripcion" defaultValue="Descripcion del Bien" />
                </Grid>
            </Grid>
        </div>
        <Divider variant="middle" flexItem="true"/>
        <div className={classes.section2}>
            <ButtonGroup variant="contained" color="primary" aria-label="contained primary button group">
                <Button>Alta</Button>
                <Button>Modificaci√≥n</Button>
                <Button>Consulta</Button>
                <Button>Baja</Button>
            </ButtonGroup>
        </div>
    </div>
);
export default Menu;
